<template>
    <div v-show="pvt_win.isShow.backMan_toolbarWindow"
         :class="{backMan_toolbar_container:true,backMan_toolbar_col:true,backMan_toolbar_col_backMan_toolbarWindow:true,backMan_toolbar_col_backMan_toolbarWindow_size_large:attr.size==='large',backMan_toolbar_col_backMan_toolbarWindow_size_medium:attr.size==='medium',backMan_toolbar_col_backMan_toolbarWindow_size_small:attr.size==='small',backMan_toolbar_col_backMan_toolbarWindow_size_min:attr.size==='min',backMan_toolbar_col_backMan_toolbarWindow_checked:pvt_win.isChecked.backMan_toolbarWindow,backMan_toolbar_col_backMan_toolbarWindow_disable:attr.disabled}"
         :style="pvt_win.style.backMan_toolbarWindow" >

        <div class="backMan_toolbar_row backMan_toolbar_row_row0">
            <div v-show="pvt_win.isShow.r1c1"
                 :class="{backMan_toolbar_col:true,backMan_toolbar_col_r1c1:true,backMan_toolbar_col_r1c1_size_large:attr.size==='large',backMan_toolbar_col_r1c1_size_medium:attr.size==='medium',backMan_toolbar_col_r1c1_size_small:attr.size==='small',backMan_toolbar_col_r1c1_size_min:attr.size==='min',backMan_toolbar_col_r1c1_checked:pvt_win.isChecked.r1c1,backMan_toolbar_col_r1c1_disable:attr.disabled}"
                 :style="pvt_win.style.r1c1" >

                <lm1a-image
                        ref="logoImg"
                        refId="logoImg"
                        v-show="pvt_isShow.r1c1 === 'logoImg'"
                        :paraVarPair="pvt_r1c1.logoImg.paraVarPair"
                        :para="pvt_r1c1.logoImg.para"
                        :attr="pvt_r1c1.logoImg.attr">
                </lm1a-image>
            </div>
        </div>

    </div>
</template>
<script>
  import libSys from '@/components/baseComponent/libSys.js';
  import libUpload from '@/components/baseComponent/libUpload.js';
  export default {
    components: {},
    inject: ['sys'],
    props: {
      refId: String,
      para: Object,
      attr: {
        type: Object,
        default: function () {
          return {size: 'medium'};
        },
        validator: function (val) {
          if(!val.size) val.size = 'medium';
          return true;
        },
      },
      paraVarPair: Object,
      number: Number,
    },
    data: function() {
      return {
          mac: mac.mac,
        pvt_subModuleMap: {
          vessel:['r1c1'],
          subModule:['logoImg'],
        },
        pvt_isShow: {
          r1c1:null,
        },
        pvt_win:{
          isShow:{
            backMan_toolbarWindow:true,
            r1c1:true,
          },
          isChecked:{
            backMan_toolbarWindow:false,
            r1c1:false,
          },
          style:{
            backMan_toolbarWindow:null,
            r1c1:null,
          },
        },
        pvt_eventPortInput: [],

        image:null,
      };
    },
    watch: {
    },
    computed:{
      pvt_r1c1:function(){
        return {
          logoImg:{
            paraVarPair:{
            },
            para:{
              image:this.image,
            },
            attr:{
            },
          },
        };
      },
    },
    created: function () {
      Object.assign(this, libSys,libUpload);
    },
    mounted: function () {
      this.pvt_initSysData();
    },
    methods: {
      startModule:function(successCallBack,errorCallBack){
        let $this = this;
        let para = {
          successCallBack: successCallBack,
          errorCallBack: errorCallBack,
          nStep: 0
        }
        let dbFlag;

        if (successCallBack !== null) {
          errorCallBack = para;
          successCallBack = null;
        }
        para = errorCallBack;

        while (1) {
          dbFlag = 0;
          switch (para.nStep) {
            case 0:
              $this.mac = mac.mac;
              $this.image = ['data:image/png;base64,'];
              // 初始化数据
              para.nStep = 'showModules';
              ++dbFlag;
              break;
            case 'showModules':
              //显示子组件
              let refId = [
                'logoImg'
              ];
              $this.showSubModule(refId, true, function () {
                para.nStep = 'forceUpdateData';
                if (++dbFlag === 2) {
                  $this.startModule(successCallBack,errorCallBack);
                }
              }, para.errorCallBack);
              break;
            case 'forceUpdateData':
              $this.forceUpdateData(function () {
                para.nStep = 'startModule_img';
                if (++dbFlag === 2) {
                  $this.startModule(successCallBack, errorCallBack);
                }
              });
              break;
            case 'startModule_img':
              //调用子组件的startModule
              $this.sm['logoImg'].startModule(function () {
                para.nStep = 'end';
                if (++dbFlag === 2) {
                  $this.startModule(successCallBack, errorCallBack);
                }
              }, para.errorCallBack);
              break;
            case 'end':
              para.successCallBack();
              return
          }
          if (++dbFlag === 1) {
            return
          }
        }
      },
    },
  };
</script>
